import React, { useState } from 'react';
import { FiBriefcase, FiHome, FiBarChart2, FiMap, FiTrendingUp, FiClipboard, FiTag, FiTerminal, FiChevronsRight } from 'react-icons/fi';
import empresaImg from '../../assets/images/empresa.png';
import './styles.css';
import jwt_decode from "jwt-decode";
import api from '../../services/api';

export interface VagaModel
{
    idVaga: number
	nome: string
	area: string
	nivelExp: string
	tipoContrato: string
	remoto: string
	detalhes: string
	idEnderecoNavigation: {
        uf: string
        cidade: string
    },
	idEmpresaNavigation: {
        nomeFantasia: string
        porteEmpresa: string
    },
    inscricao: [{
        idAluno: number
    }]
}


    const auth = `Bearer ${localStorage.getItem('conectando-key-auth')}`;

    let decoded: any = jwt_decode(auth);

    console.log(decoded);

    const [nome, setNome] = useState('');
    const [nivelExp, setNivelExp] = useState('');
    const [tipoContrato, setTipoContrato] = useState('');
    const [remoto, setRemoto] = useState('');
    const [area, setArea] = useState('');
    const [detalhes, setDetalhes] = useState('');
    const [horario, setHorario] = useState('');
    const [salario, setSalario] = useState('');
    const [requisitos, setRequisitos] = useState('');
    const [bonus, setBonus] = useState('');

    const idVagaLocal = localStorage.getItem('idVaga')

    function load() {
        api.get('/vaga'+idVagaLocal, {
            headers: {
                'Accept': 'application/json, text/plain, /',
                'Content-Type': 'application/json',
                authorization: auth
            }
        })
            .then(function (response) {
                setNome(response.data.nome);
                setNivelExp(response.data.nivelExp);
                setTipoContrato(response.data.tipoContrato);
                setRemoto(response.data.remoto);
                setArea(response.data.area);
                setDetalhes(response.data.detalhes);
                setHorario(response.data.horario);
                setSalario(response.data.salario);
                setRequisitos(response.data.requisitos);
                setBonus(response.data.bonus);


                console.log(response.data);
            })
            .catch(function (error) {

                console.log(error);
            });
    }

interface Inscricao
{
    idAluno: number
}


interface ModeloProps
{
    modelo: VagaModel;
}

const ModeloVaga: React.FC<ModeloProps> = ({  modelo  }) => {
    return (
        <div className="container">
            <div className="header espaco">
                <div className="empresa espaco">
                    <img src={empresaImg} alt="" />

                    

                    <h2>{modelo.nome}</h2>

                </div>
                <span>
                    <FiTag size={24} color="#4E4E4E" />
                    {modelo.area}
                </span>
            </div>
            <div className="infos espaco">
                <ul>
                    <div>
                        <li><FiBriefcase size={24} color="#4E4E4E" />Nome empresa: {modelo.idEmpresaNavigation.nomeFantasia}</li>
                        <li><FiBarChart2 size={24} color="#4E4E4E" />Empresa {modelo.idEmpresaNavigation.porteEmpresa}</li>
                        <li><FiMap size={24} color="#4E4E4E" />{modelo.idEnderecoNavigation.cidade} - {modelo.idEnderecoNavigation.uf} </li>
                    </div>
                    <br />
                    <div>
                        <li><FiTrendingUp size={24} color="#4E4E4E" /> NÃ­vel de exp: {modelo.nivelExp} </li>
                        <li><FiClipboard size={24} color="#4E4E4E" /> Tipo de contrato: {modelo.tipoContrato}</li>
                        <li><FiHome size={24} color="#4E4E4E" /> Parte em remoto: {modelo.remoto}</li>
                    </div>
                </ul>
            </div>
            <span className="detalhes espaco">
                <FiTerminal size={24} color="#4E4E4E" />
                <p>
                    {modelo.detalhes}
                </p>
            </span>

            <span className="maisDetalhes">Mais detalhes<FiChevronsRight size={24} color="#FF0000" /></span>
        </div>
    )
}

export default ModeloVaga;
